import React from "react";
const Index = () => {
  return (
    <>
      <label>firstName</label>
      <input type="text" placeholder="enter some firstName" />
      <br />
      <label>lastName</label>
      <input type="text" placeholder="enter some lastName" />
      <br />
      <label>email:</label>
      <input type="text" placeholder="enter some email" />
      <br />
      <label>password:</label>
      <input type="text" placeholder="enter some password" />
      <br />
      <label>Confirm password:</label>
      <input type="text" placeholder="enter confirm password" />
    </>
  );
};
export default Index;
